import React from 'react';
import {Card} from 'react-bootstrap';
import { connect } from 'react-redux';
import Task from '../Task/Task';
class DoneList extends React.PureComponent
{
   render()
   {
       return(
        <Card className="DoingList_card">
        <Card.Body>
            <Card.Text> Done </Card.Text>
            {
            this.props.doingTasks.filter(t => t.completed).map(t => (<Task key={t.id} {...t} ></Task>))
            }
        </Card.Body>
        </Card>
       )
   }
}
const mapStateToProps = state => ({

    doingTasks: state.doingTasks,
  });

  export default connect(mapStateToProps)(DoneList);
